    [TestClass]
    public class TestColorRoundTrip
    {
        private static CS.RGBWorkingSpaces spaces = new CS.RGBWorkingSpaces();
        private static CS.RGBWorkingSpace SRGB_D65_2 = spaces.SRGB_D65_Degree2;
        [TestMethod]
        public void check_hsv_to_rgb()
        {
            var c1 = new CS.ColorHSV(1.0, 1.0, 1.0);
            var c2 = new CS.ColorRGB(c1);
        }

        [TestMethod]
        public void check_hsl_to_rgb()
        {
            var c1 = new CS.ColorHSL(1.0, 1.0, 1.0);
            var c2 = new CS.ColorRGB(c1);
        }

        public void round_trip_web_color_via_hsv(string webcolor)
        {
            var c0 = CS.ColorRGB32Bit.ParseWebColorString(webcolor);
            var c1 = System.Drawing.Color.FromArgb(c0.ToInt());
            var c2 = new CS.ColorRGB(c1.ToArgb());
            var c3 = new CS.ColorHSV( c2);
            var c4 = new CS.ColorRGB(c1.ToArgb());
            string out_webcolor = c0.ToWebColorString();
            Microsoft.VisualStudio.TestTools.UnitTesting.Assert.AreEqual(webcolor, out_webcolor);
        }

        public void round_trip_web_color_via_hsl(string webcolor)
        {
            var c0 = CS.ColorRGB32Bit.ParseWebColorString(webcolor);
            var c1 = System.Drawing.Color.FromArgb(c0.ToInt());
            var c2 = new CS.ColorRGB(c1.ToArgb());
            var c3 = new CS.ColorHSL(c2);
            var c4 = new CS.ColorRGB(c1.ToArgb());
            string out_webcolor = c0.ToWebColorString();
            Microsoft.VisualStudio.TestTools.UnitTesting.Assert.AreEqual(webcolor, out_webcolor);
        }

        [TestMethod]
        public void RoundTripWebColorViaHSV()
        {
            round_trip_web_color_via_hsv("#c0c0c0");
            round_trip_web_color_via_hsv("#0000ff");
            round_trip_web_color_via_hsv("#00ff00");
            round_trip_web_color_via_hsv("#ff0000");
            round_trip_web_color_via_hsv("#000000");
            round_trip_web_color_via_hsv("#ffffff");
            round_trip_web_color_via_hsv("#c0c0c0");
        }

        [TestMethod]
        public void RoundTripWebColorViaHSL()
        {
            round_trip_web_color_via_hsv("#c0c0c0");
