            round_trip_web_color_via_hsl("#ffffff");
            round_trip_web_color_via_hsl("#c0c0c0");
        }

        [TestMethod]
        public void RoundTrip_Sytem_Drawing_Colors()
        {
            var records = GetColorRecords();

            foreach (var record in records)
            {
                var c0 = record.Color;
                check_roundtrip_rgb(c0);
                check_roundtrip_hsl(c0);
                check_roundtrip_hsv(c0);
                check_roundtrip_cmyk(c0);
                check_roundtrip_xyz(c0);
                check_roundtrip_lab(c0);
            }
        }

        private static List<ColorRecord> GetColorRecords()
        {
            var ct = typeof (System.Drawing.Color);
            var props = ct.GetProperties(System.Reflection.BindingFlags.Static | System.Reflection.BindingFlags.Public);
            var colorprops = props.Where(p => p.PropertyType == ct).ToArray();

            var col = new List<ColorRecord>();
            foreach (var p in colorprops)
            {
                var realcolor = (System.Drawing.Color) p.GetValue(null, null);
                var item = new ColorRecord(realcolor.Name, p.Name, realcolor);
                col.Add(item);
            }
            return col;
        }

        private static void check_roundtrip_rgb(Color c0)
        {
            var c1 = new CS.ColorRGB(c0.ToArgb());
            var c2 = new CS.ColorRGB32Bit(c1);
            var c3 = System.Drawing.Color.FromArgb(c2.ToInt());
            var c4 = new CS.ColorRGB32Bit(c3.ToArgb());
            var c5 = new CS.ColorRGB(c4);

            Assert.AreEqual(c0.R, c3.R);
            Assert.AreEqual(c0.G, c3.G);
            Assert.AreEqual(c0.B, c3.B);
            Assert.AreEqual(c0.A, c3.A);

            Assert.AreEqual(c2.R, c3.R);
            Assert.AreEqual(c2.G, c3.G);
            Assert.AreEqual(c2.B, c3.B);
            Assert.AreEqual(c2.Alpha, c3.A);

            Assert.AreEqual(c1.R, c5.R);
            Assert.AreEqual(c1.G, c5.G);
            Assert.AreEqual(c1.B, c5.B);
            Assert.AreEqual(c1.Alpha, c5.Alpha);
        }

        private static void check_roundtrip_hsl(Color c0)
        {
            var c1 = new CS.ColorRGB(c0.ToArgb());
            var c2 = new CS.ColorHSL(c1);
            var c3 = new CS.ColorRGB(c2);
            var c4 = new CS.ColorRGB32Bit(c3);
            var c5 = System.Drawing.Color.FromArgb(c4.ToInt());
            Assert.AreEqual(c0.R, c5.R, 1.0);
            Assert.AreEqual(c0.G, c5.G, 1.0);
            Assert.AreEqual(c0.B, c5.B, 1.0);
            Assert.AreEqual(c0.A, c5.A);
        }

        private static void check_roundtrip_hsv(Color c0)
        {
            var c1 = new CS.ColorRGB(c0.ToArgb());
            var c2 = new CS.ColorHSV(c1);
            var c3 = new CS.ColorRGB(c2);
            var c4 = new CS.ColorRGB32Bit(c3);
            var c5 = System.Drawing.Color.FromArgb(c4.ToInt());
            Assert.AreEqual(c0.R, c5.R, 1.0);
            Assert.AreEqual(c0.G, c5.G, 1.0);
            Assert.AreEqual(c0.B, c5.B, 1.0);
            Assert.AreEqual(c0.A, c5.A);
        }

        private static void check_roundtrip_cmyk(Color c0)
        {
            var c1 = new CS.ColorRGB(c0.ToArgb());
            var c2 = new CS.ColorCMYK(c1);
            var c3 = new CS.ColorRGB(c2);
            var c4 = new CS.ColorRGB32Bit(c3);
            var c5 = System.Drawing.Color.FromArgb(c4.ToInt());
            Assert.AreEqual(c0.R, c5.R, 1.0);
            Assert.AreEqual(c0.G, c5.G, 1.0);
            Assert.AreEqual(c0.B, c5.B, 1.0);
            Assert.AreEqual(c0.A, c5.A);
        }

        private static void check_roundtrip_xyz(Color c0)
        {
            var c1 = new CS.ColorRGB(c0.ToArgb());
            var c2 = new CS.ColorXYZ(c1, SRGB_D65_2);
            var c3 = new CS.ColorRGB(c2, SRGB_D65_2);
            var c4 = new CS.ColorRGB32Bit(c3);
            var c5 = System.Drawing.Color.FromArgb(c4.ToInt());
            Assert.AreEqual(c0.R, c5.R, 1.0);
            Assert.AreEqual(c0.G, c5.G, 1.0);
            Assert.AreEqual(c0.B, c5.B, 1.0);
            Assert.AreEqual(c0.A, c5.A);
        }

        private static void check_roundtrip_lab(Color c)
        {
            var c0 = new CS.ColorRGB(c.ToArgb());
            var c1 = new CS.ColorXYZ(c0, SRGB_D65_2);
            var c2 = new CS.ColorLAB(c1, SRGB_D65_2);
            var c3 = new CS.ColorRGB( new CS.ColorXYZ(c2,SRGB_D65_2), SRGB_D65_2);
            var c4 = new CS.ColorRGB32Bit(c3);
            var c5 = System.Drawing.Color.FromArgb(c4.ToInt());
            Assert.AreEqual(c.R, c5.R, 1.0);
            Assert.AreEqual(c.G, c5.G, 1.0);
            Assert.AreEqual(c.B, c5.B, 1.0);
            Assert.AreEqual(c.A, c5.A);
        }


        public IEnumerable<string> get_lines_from_string(string s)
        {
            
            var lines = s.SPLIT('\n');
            foreach (string line in lines)
            {
                string tline = line.Trim();
                if (tline.Length < 1)
                {
                    continue;
                }

                yield return line.Trim();
            }
        }

        [TestMethod]
        public void ValidateGray1()
        {
            var values = new double[] {0.0, 0.3, 0.5, 0.8, 1.0};
            foreach (var v in values)
            {
                var c0 = new CS.ColorRGB(v,v,v);
                var c1 = new CS.ColorHSL(c0);
                var c2 = new CS.ColorHSV(c0);
                Assert.IsTrue(double.IsNaN(c2.H));
                Assert.IsTrue(double.IsNaN(c1.H));
            }

        }

        [TestMethod]
        public void ValidateGray2()
        {
            var values = new double[] { 0.0, 0.3, 0.5, 0.8, 1.0 };
            foreach (var v in values)
            {
                var c0 = new CS.ColorHSV(double.NaN, double.NaN, v);
                var c1 = new CS.ColorHSL(double.NaN, double.NaN, v);

                var c0_rgb = new CS.ColorRGB(c0);
                Assert.IsTrue(c0_rgb.R == c0_rgb.G && c0_rgb.G == c0_rgb.B);

                var c1_rgb = new CS.ColorRGB(c1);
                Assert.IsTrue(c1_rgb.R == c1_rgb.G && c1_rgb.G == c1_rgb.B);

                Assert.IsFalse(c0.IsChromatic());
                Assert.IsFalse(c1.IsChromatic());
                Assert.IsFalse(c0_rgb.IsChromatic());
                Assert.IsFalse(c1_rgb.IsChromatic());
                //var c1 = new VC.ColorHSL(c0);
                //var c2 = new VC.ColorHSV(c0);
                //Assert.IsTrue(double.IsNaN(c2.H));
                //Assert.IsTrue(double.IsNaN(c1.H));
            }

        }




        [TestMethod]
        public void ValidateColorTranslation()
        {
            string pal_str = PalettesData.WikipediaColorList;
            foreach (string line in get_lines_from_string(pal_str))
            {
                var tokens = line.Replace("(","").Replace(")","").Replace("rgb=","").Replace("hsv=","").Replace("hsl=","").Split(new char[] { ',' });
                string name = tokens[0];
                string webcolor = tokens[1];
                var rgbint = CS.ColorRGB32Bit.ParseWebColorString(webcolor);
                var rgb = new CS.ColorRGB(rgbint);
                var hsv = new CS.ColorHSV(rgb);
                var hsl = new CS.ColorHSL(rgb);

                var doubles = tokens.Skip(2).Select(i => todouble(i)).ToArray();
                Assert.AreEqual(9,doubles.Length);

                var std_rgb = new CS.ColorRGB(doubles[0], doubles[1], doubles[2]);
                var std_hsl = new CS.ColorHSL(doubles[3], doubles[4], doubles[5]);
                var std_hsv = new CS.ColorHSV(doubles[6], doubles[7], doubles[8]);




                double delta = 0.000000000001;
                checkequal(std_rgb, rgb, delta);
                checkequal(std_hsv, hsv, delta);
                checkequal(std_hsl, hsl, delta);
            }
        }

        public double todouble(string s)
        {
            bool success;
            double d;
            success = double.TryParse(s, out d);
            if (success)
            {
                return d;
            }
            else
            {
                return double.NaN;
            }
        }

        public void nanequal(double a, double b, double delta)
        {
            if (double.IsNaN(a))
            {
                Assert.IsTrue(double.IsNaN(b));
            }
            else
            {
                Assert.IsFalse(double.IsNaN(b));
                Assert.AreEqual(a, b, delta);                
            }
        }

        public void checkequal(CS.ColorRGB a, CS.ColorRGB b, double delta)
        {
            nanequal(a.R, b.R, delta);
            nanequal(a.G, b.G, delta);
            nanequal(a.B, b.B, delta);            
        }

        public void checkequal(CS.ColorHSL a, CS.ColorHSL b, double delta)
        {
            nanequal(a.H,b.H, delta);
            nanequal(a.S,b.S, delta);
            nanequal(a.L,b.L, delta);
        }

        public void checkequal(CS.ColorHSV a, CS.ColorHSV b, double delta)
        {
            nanequal(a.H, b.H, delta);
            nanequal(a.S, b.S, delta);
            nanequal(a.V, b.V, delta);
        }


        public string striplast(string s)
        {
            if (s.Length < 1)
            {
                return s;
            }
            return s.Substring(0, s.Length - 1);
        }

        public int striplastint(string s)
        {
            return int.Parse(striplast(s));
        }

    }

    public static class Ext
    {
        public static string[] SPLIT(this string s, char c)
        {
            return s.Split(new char [] {c});
        }

        public static bool IsChromatic(this CS.ColorRGB c)
        {
            return !((c.R == c.G) && (c.G==c.B));
        }
    }

    public class ColorRecord
    {
        public string Name;
        public string ID;
        public System.Drawing.Color Color;

        public ColorRecord(string name, string id, System.Drawing.Color c)
        {
            this.Name = name;
            this.ID = id;
            this.Color = c;
        }
    }

